import one from "../images/mypics/1.jpeg";
import two from "../images/mypics/2.jpg";
import three from "../images/mypics/3.jpg";
import four from "../images/mypics/4.jpg";
import five from "../images/mypics/5.jpg";
import six from "../images/mypics/6.jpg";

const BlogData = [
  { id: 1, imgsrc: one },
  { id: 2, imgsrc: two },
  { id: 3, imgsrc: three },
  { id: 4, imgsrc: four },
  { id: 5, imgsrc: five },
  { id: 6, imgsrc: six },
];

export default BlogData;
